import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import Axios from "axios";

import FacebookLogin from "react-facebook-login";

const Login = () => {
  const hendelClick = async () => {
    const res = await Axios.get("/playground");
    console.log(res);
  };

  const componentClicked = () => console.log("clicked");
  const responseFacebook = (res) => console.log(res);

  const LoginButton = ({ facebookResponse }) => (
    <FacebookLoginWithButton
      appId="1206715649505081"
      // autoLoad
      fields="name,email,picture"
      onClick={componentClicked}
      callback={facebookResponse}
      icon="fa-facebook"
    />
  );

  return (
    <Fragment>
      <div className="login">
        <div className="ui basic  aligned segment">
          <h1 className="center">Login</h1>
          <div className="ui action left icon input">
            <form className="ui form">
              <div className="field left">
                <label>Username</label>
                <div className="ui left icon input">
                  <input type="text" placeholder="Username" />
                  <i aria-hidden="true" className="user icon"></i>
                </div>
              </div>
              <div className="field left">
                <label>Password</label>
                <div className="ui left icon input">
                  <input type="password" />
                  <i aria-hidden="true" className="lock icon"></i>
                </div>
              </div>
              <button className="ui primary button">Login</button>
              <div className="ui hidden divider"></div>
              <p>
                If you are not user plz{" "}
                <Link to="/registrasiton">Registrasiton</Link>
              </p>
            </form>
          </div>
          <div className="ui hidden divider"></div>
          <div className="ui horizontal divider">Or</div>
          <div className="ui hidden divider"></div>
          <LoginButton facebookResponse={facebookResponse} />

          <button className="ui twitter button">
            <i aria-hidden="true" className="twitter icon"></i>
            Twitter
          </button>
          <button className="ui google plus button" onClick={hendelClick}>
            <i aria-hidden="true" className="google plus icon"></i>
            Google Plus
          </button>
          <button className="ui linkedin button">
            <i aria-hidden="true" className="linkedin icon"></i>
            LinkedIn
          </button>
        </div>
      </div>
    </Fragment>
  );
};

export default Login;
